function App() {
  return (
    <div>
      <Router>
        <Switch>

         <Route exact path="/">
            <PersonList />
         </Route>

        <Route path="/signIn">
            <Sign-in/>
        </Route>

        </Switch>
      </Router>
    </div>
  );
}

export default App;
